import React, { useEffect, useState } from "react";
import AdminNavbar from "../../components/AdminNavbar";
import axios from "axios";
import Loader from "../../components/Loader";
import { Link } from "react-router-dom";

const AdminDashboard = () => {
  const [stats, setStats] = useState({});
  const [courses, setCourses] = useState([]);
  const [lectures, setLectures] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  const token = localStorage.getItem("adminToken");
  const config = { headers: { Authorization: `Bearer ${token}` } };

  useEffect(() => {
    const fetchDashboard = async () => {
      setLoading(true);
      try {
        const [statsRes, coursesRes, lecturesRes] = await Promise.all([
          axios.get("http://localhost:5000/api/admin/dashboard", config),
          axios.get("http://localhost:5000/api/admin/courses", config),
          axios.get("http://localhost:5000/api/admin/lectures", config),
        ]);
        setStats(statsRes.data);
        setCourses(coursesRes.data);
        setLectures(lecturesRes.data);
      } catch (err) {
        console.error(err);
        setError("Failed to fetch dashboard data");
      } finally {
        setLoading(false);
      }
    };

    fetchDashboard();
  }, []);

  if (loading) return <Loader />;

  return (
    <div>
      <AdminNavbar />
      <div className="container">
        <h1>Admin Dashboard</h1>
        {error && <p>{error}</p>}

        <div>
          <h3>Stats</h3>
          <ul>
            <li>Total Courses: {stats.totalCourses}</li>
            <li>Total Lectures: {stats.totalLectures}</li>
            <li>Total Instructors: {stats.totalInstructors}</li>
          </ul>
        </div>

        <div>
          <h3>Courses</h3>
          <Link to="/admin/add-course">Add Course</Link>
          <ul>
            {courses.map((course) => (
              <li key={course._id}>
                {course.title} - {course.instructor?.name || "No Instructor"}
              </li>
            ))}
          </ul>
        </div>

        <div>
          <h3>Lectures</h3>
          <Link to="/admin/add-lecture">Add Lecture</Link>
          <ul>
            {lectures.map((lec) => (
              <li key={lec._id}>
                {lec.title} - {lec.course?.title} - {lec.instructor?.name}
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
